import { Link } from "react-router-dom";

const TableRow = (props) => {
  const { memberz } = props;

  // 회원 탈퇴 함수 선언
  const memberWithdraw = async () => {
    alert("탈퇴 진행완료");
  };

  return (
    <tr>
      <td>{memberz.memberNum}</td>
      <td>
        {/* <Link to={`/admin/member/view/${notice.noticeNum}`}> */}
        {memberz.memberEmail}
        {/* </Link> */}
      </td>
      <td>{memberz.memberProfile}</td>
      <td>{memberz.memberReg}</td>
      <td>{memberz.memberLeave}</td>
      <td>
        <Link className="btn btn-outline-danger" onClick={memberWithdraw}>
          탈퇴
        </Link>
      </td>
    </tr>
  );
};

export default TableRow;
